import ExpenseItem from "./components/ExpenseItem";

function App() {
    const expenses = [
        { id: "1", title: "a", amount: 294.67, date: new Date(2008, 1, 2) },
        { id: "2", title: "b", amount: 294.67, date: new Date(2012, 3, 4) },
        { id: "3", title: "c", amount: 294.67, date: new Date(2016, 5, 6) },
    ];
    return (
        <div>
            <h2>Let's get started!!</h2>
            <ExpenseItem expense = {expenses[0]} />
            <ExpenseItem expense = {expenses[1]} />
            <ExpenseItem expense = {expenses[2]} />
        </div>
    );
}

export default App;
